    if (history.length > 8) {
      const movePosition = (history.length - 8) % 9;

      // compare two hitory to get a move
      const index = history[movePosition].findIndex((element, i) => el )

      console.log((history.length - 8) % 9);
    }
  }, [history, currentMove]);

  function handlePlay(nextBoard) {
    const updatedHistory = [...history.slice(0, currentMove + 1), nextBoard];
    setHistory(updatedHistory);
    setCurrentMove(updatedHistory.length - 1);
  }

  function jumpTo(moveTo) {
    setCurrentMove(moveTo);
  }

  const historyDisplayedList = history.map((el, move) => {
    let text = `Go to move # ${move}`
    return move > 0 && (
        <li key={`move_${move}`}>
